import React from 'react'
import { Field, reduxForm } from 'redux-form'
// import Input from '../../../components/input/Input/Input'
// import Checkbox from '../../../components/input/Checkbox/Checkbox'
import { Button } from 'reactstrap'

const renderField = ({ input, meta, label, type }) => (
  <div>
    <pre>{JSON.stringify(meta)}</pre>
    <label>{label}</label>
    <input {...input} placeholder={label} type={type} />
  </div>
)

const Form = ({ handleSubmit, props }) => {
  console.log('props zde', props)
  //</form> <form onSubmit={handleSubmi(props.showData)}></form> jak by se to muselo zapsat aby to šlo, když bych chtěl showData tahat skrze props?
  return (
    <form onSubmit={handleSubmit}>
      <Field type="text" component={renderField} label="Krestni jmeno" />
      <Field component={renderField} label="GDPR" type="checkbox" />
      <br />
      <Button color="danger">Odeslat</Button>
    </form>
  )
}

export default reduxForm({
  form: 'testForm',
})(Form)
